import React from "react";
import navIcon from "../assets/navIcon.svg";
import "../components/style.css";
const Navbar = () => {
  return (
    <div className="container fixed z-10 navbar__earthly flex rounded-[1.31rem] drop-shadow-lg items-center justify-between px-4 py-4 mx-auto w-[71.063rem] h-[5.25rem] border-2 bg-white">
      <div className=" font-[itim] text-4xl pl-4 items-center justify-center">
        <p>earthly.ie</p>
      </div>
      <ul className="flex list-none gap-16 font-[inter] items-center justify-center text-[1.375rem] pr-4 cursor-pointer">
        <li>Home</li>
        <li>Shop</li>
        <li>About Us</li>
        <li>
          <button className=" rounded-[0.563rem] bg-primaryTwo py-2 px-4">
            Get in Touch
          </button>
        </li>
        <li className="scale-[]">
          <img src={navIcon} alt="Cart Icon" />
        </li>
      </ul>
    </div>
  );
};

export default Navbar;
